import { Version } from "./base";
import { CANVAS_FONT_PATH, CANVAS_FALLBACK_FONT_PATH }  from './config';
const fs = require('fs');

export function importFont(font_path: string, media_type: string) {
    const buff = fs.readFileSync(font_path);
    const base64data = buff.toString('base64');
    return `data:${media_type};charset=utf-8;base64,${base64data}`;
}

const fontJakartaBold = importFont(CANVAS_FONT_PATH, 'font/truetype');
const fontDejaVuBold = importFont(CANVAS_FALLBACK_FONT_PATH, 'font/truetype');
// const fontNotoColorEmoji = font2base64.encodeToDataUrlSync(CANVAS_EMOJI_FONT_PATH);

interface SVGTemplateFields {
  backgroundImage?: string;
  domain: string;
  domainFontSize: number;
  isNormalized: boolean;
  isSubdomain: boolean;
  mimeType?: string;
  subdomainText?: string;
  version: Version;
}

const contractAddressToSvgTemplate: any = {
  // sbch
  "0x32650517d7d4c54935197ff5f3e575d5fb210a63": createLnsSVGfromTemplate,  // .bch

  // sbch testnet
  "0xaf712c515b92ac7685905796b5ee1b1d1116798b": createLnsSVGfromTemplate,  // .bch

  // dogechain
  "0x0af878360b48b5f51f4e919f3cc1ec08b78627ad": createDnsSVGfromTemplate, // .doge
  "0xe83c2021550b17169bd2d608c51ba6a2bea0f350": createDnsDCSVGfromTemplate,   // .dc

  // dogechain testnet
  "0x07d127d14bbd2af65fd86537913acad35d6c0682": createDnsSVGfromTemplate, // .doge
  "0x1070aaf6115ff3f8d6307f39c7a7a3fac622879c": createDnsDCSVGfromTemplate,   // .dc

  // ethpow mainnet
  "0x0a0bacad455e764d834adf4916b5432e2054686d": createPownsEthwSVGfromTemplate,  // .ethw
}

export default function createSVGfromTemplate(contractAddress: string, options: SVGTemplateFields) {
  const func = contractAddressToSvgTemplate[contractAddress.toLocaleLowerCase()];
  if (func) {
    return func(options);
  }

  return createLnsSVGfromTemplate(options);
}

